INSERT INTO `movie` VALUES ('DreamGirl','2021-10-18 19:43:00','2020-10-18 19:43:00','DreamGirl','2020-10-19 16:05:26',NULL,'Raaj Shaandilyaa','132 min','HINDI','Dream Girl','Rom-com Movie, directed by Raaj Shaandilyaa, stars Ayushmann Khurrana who plays a \'dream girl\'. In every love story, there is always one trying to win the heart of the other, who could be the dream girl','https://m.media-amazon.com/images/M/MV5BNmUyMzU3YjgtZTliNS00NWM2LWI5ODgtYWE3ZjAzODgyNjNhXkEyXkFqcGdeQXVyNjY1MTg4Mzc@._V1_SX300.jpg','8.0','2020','VibrantMallHyderabad','not available','Drama, Comedy','2020-10-19 16:07:13'),('HouseFull4','2021-10-18 19:43:00','2019-10-18 19:43:00','HouseFull4','2020-10-19 15:01:39',NULL,'Farhad Samji','142 min','HINDI','HouseFull 4','When 6 lovers are parted because of conspiracy and revenge in the year 1419, the characters cross paths again in 2019. However, in the present life the 3 boys are about to marry their sisters-in-law and the pairings are in the wrong order','https://m.media-amazon.com/images/M/MV5BYjIyODM0OTAtMmYwNS00YTA1LTkwMjctYzcwZWFhZjcyMWM2XkEyXkFqcGdeQXVyOTAzMTc2MjA@._V1_SX300.jpg','3.4','2019','Garudamallimax','not available','Drama, Romance','2020-10-19 15:07:17'),('LoveAAjKal','2020-10-18 19:43:00','2020-10-18 19:43:00','LoveAAjKal','2020-10-19 14:57:14',NULL,'Imtiaz Ali','142 min','HINDI','Love AAj Kal','Two different individuals on a journey of love, loss and life','https://m.media-amazon.com/images/M/MV5BMjNhYzc0YmItOGZjOS00NWJlLWE3ZTEtNGI3MzAxNGYwZWExXkEyXkFqcGdeQXVyMTA5NzIyMDY5._V1_SX300.jpg','5.0','2012','Garudamallimax','not available','Drama, Romance','2020-10-19 14:57:54'),('Simmba','2021-10-18 19:43:00','2020-10-18 19:43:00','Simmba','2020-10-19 15:46:17',NULL,'Rohit Shetty','142 min','HINDI','Simmba','Simmba is an orphan from Shivgadh from where our beloved Singham was born and raised. Contrary to the philosophies of Singham, Simmba believes that a Corrupt Officer`s life is an ideal life which inspires him to become one.','https://m.media-amazon.com/images/M/MV5BMWIzNGU3ZWEtNTRjOC00OTYzLWFlZmUtMjE5NmMxMmE0MGIwXkEyXkFqcGdeQXVyNjE1OTQ0NjA@._V1_SX300.jpg','7.0','2020','JaipurCentralMall','not available','Drama, Romance','2020-10-19 15:47:59'),('Tanhaji:TheUnsungWarrior','2021-10-18 19:43:00','2020-10-18 19:43:00','Tanhaji:TheUnsungWarrior','2020-10-19 15:04:59',NULL,'Om Raut','142 min','HINDI','Tanhaji: The Unsung Warrior','Tanhaji Malusare, a military chieftain in the army of the Maratha king Shivaji, leads the charge to capture the strategically important Kondhana fort guarded by the army of the fierce Rajput chieftain Udaybhan Rathod','https://m.media-amazon.com/images/M/MV5BMDc5ZmQ3MzUtYTY4OS00YTE3LTkwNmItNmQ2ODIwNWM3MzY1XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_SX300.jpg','7.4','2020','Garudamallimax','not available','History, Drama','2020-10-19 15:09:03');
